import React from 'react'

function GenerateProtocols({composition_of_sec}) {
    handleClick = async () => {
        await generateTask({
          request_data_task: this.props.request_data_task,
          schedule_stud_prof: this.state.editedStages,
        });
      };
  return (
    <div>
        <h4 className='text-center'> Генерация протоколов</h4>
        <Button variant='none' className={styles_base.button_cancel} onClick={this.handleClick}>Создать протокол</Button>
    </div>
  )
}

export default GenerateProtocols
